def main():
    # Required fields
    st.title("Check your car value!")
    st.header("Required fields:")
    # Brand selection
    brand = st.selectbox('Select Brand', list(car_data.keys()))

    # Model selection based on the brand
    if brand in car_data:
        model = st.selectbox('Select Model', list(car_data[brand].keys()))

    # Version selection based on the brand and model
    if brand in car_data and model in car_data[brand]:
        version = st.selectbox('Select Version', car_data[brand][model])


    # Additional fields after selection from the list
    st.header("Additional fields:")
    selected_fields = st.multiselect("Select fields to add:", available_fields)
    for field in selected_fields:
        value = st.text_input(field, key=f"additional_field_{field}")
        if not value:  # If the field is empty
            st.markdown(f'<style>input[placeholder="{field}"] {{border: 1px solid red;}}</style>', unsafe_allow_html=True)


        # Submit button
    if st.button("Submit"):
        missing_fields = [field for field in ["Brand", "Model", "Version"] if not locals()[field.lower()]]
        if missing_fields:
             st.error(f"The following required fields are missing: {', '.join(missing_fields)}")
             for field in missing_fields:
                        
                 st.markdown(f'<style>select[name="{field.lower()}"] {{border: 1px solid red;}}</style>', unsafe_allow_html=True)
        else:
             st.success("All required fields are filled!")


